import React from 'react'
import MaterialTable from 'material-table';


export default function PaddockTable() {
    const [open, setOpen] = React.useState(false);
    const handleClickOpen = () => {
        setOpen(true);
    };
    const handleClose = (event, reason) => {
        setOpen(false);

    };

    const [data, setData] = React.useState([
        { name: 'Linta Paddock', size: '23ac', cultivar: 'fallow', rotation: 'NR', year: 2017 },
        { name: 'K2K Paddock', size: '50ac', cultivar: 'dfg', rotation: 'DC', year: 2019 },
        { name: 'Harry Woods Paddock', size: '40ac', cultivar: 'abc', rotation: 'LF', year: 2020 },
        { name: 'Peter Dein Co.', size: '10ac', cultivar: 'abc', rotation: 'SF', year: 2019 }
         ])
    const columns = [{
        title: 'Name', field: 'name'
    },
    {
        title: 'Size', field: 'size', type: 'numeric'
    }, {
        title: 'Cultivar', field: 'cultivar', 
        lookup: { 'fallow': 'Fallow', 'abc': 'abc', 'dfg':'dfg' },
    }, {
        title: 'Rotation', field: 'rotation',
        lookup: {'D': 'Dryland' ,'NR': 'Normal Rotation', 'DC': 'Double Crop', 'LF': 'Long Fallow', 
        'SF': 'Short Fallow', 'I': 'Irrigated', 'SI': 'Semi-irrigated', 'D': 'Dryland', 'AP': 'After Pulse' },
    }, {
        title: 'Year', field: 'year', type: 'numeric'
    }]
    return (
        <div>
            <MaterialTable title="Paddocks"
                data={data}
                columns={columns}
                editable={{
                
                        onRowAdd: newData =>
          new Promise((resolve, reject) => {
            setTimeout(() => {
              setData([...data, newData]);
              
              resolve();
            }, 1000)
          }),
        onRowUpdate: (newData, oldData) =>
          new Promise((resolve, reject) => {
            setTimeout(() => {
              const dataUpdate = [...data];
              const index = oldData.tableData.id;
              dataUpdate[index] = newData;
              setData([...dataUpdate]);

              resolve();
            }, 1000)
          }),
          
        onRowDelete: oldData =>
          new Promise((resolve, reject) => {
            setTimeout(() => {
              const dataDelete = [...data];
              const index = oldData.tableData.id;
              dataDelete.splice(index, 1);
              setData([...dataDelete]);
              
              resolve()
            }, 1000)
          }),
                }}
               
                options={{
                    actionsColumnIndex: -1,
                    filtering: true
                }}
            /> {/*--------------------------------------------Completed jobs popup---------------------
            <Dialog open={open} onClose={handleClose} maxWidth="sm" scroll="paper">
                <DialogTitle sx={{ fontSize: 24, fontWeight: 'large' }}>New Item</DialogTitle>
                <DialogContent>
                    <Cultivarsmain />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">CANCEL</Button>
                    <Button onClick={handleClose} color="primary">SAVE</Button>
                </DialogActions>
            </Dialog>-*/}
        </div>
    )
}
